import React from 'react';

interface Props {
    data?: {};
}

const Journals: React.FC<Props> = (props) => {
    const results: any = props.data;
    delete results['uids'];

    console.log(results);
    return (
        <>
            <div>{Object.keys(results).map((key) => <div key={key} data-attr={key}>FUCK YOU</div>)}</div>
        </>
    );
};

export default Journals;
